import React, { useState } from "react";
import { Container, Grid, Paper, Typography } from "@mui/material";
import Header from "../components/Header";
import Sidebar from "../components/Sidebar";

const categories = [
  { title: "General Aptitude", items: ["Arithmetic Aptitude", "Data Interpretation", "Online Tests"] },
  { title: "Interview", items: ["Placement Papers", "Group Discussion", "HR Interview"] },
  { title: "Engineering", items: ["Mechanical", "Civil", "CSE", "EEE"] },
  { title: "Programming", items: ["C", "C++", "Java", "Python"] },
];

const Home = () => {
  const [openSidebar, setOpenSidebar] = useState(true);

  // Toggle Sidebar
  const handleSidebarToggle = () => {
    setOpenSidebar(!openSidebar);
  };

  return (
    <div style={{ display: "flex" }}>
      {/* Sidebar Component */}
      <Sidebar openSidebar={openSidebar} />

      <div style={{ flexGrow: 1, padding: "20px", marginLeft: openSidebar ? "240px" : "0px", transition: "margin 0.3s" }}>
        {/* Header Component */}
        <Header toggleSidebar={handleSidebarToggle} isSidebarOpen={openSidebar} />

        {/* Main Content */}
        <Container sx={{ mt: 8 }}>
          <Typography variant="h4" sx={{ mb: 2, color: "orange" }}>
            Welcome to AptitudeArc!
          </Typography>
          <Grid container spacing={3}>
            {categories.map((category, index) => (
              <Grid item xs={12} md={6} lg={4} key={index}>
                <Paper sx={{ padding: 2, backgroundColor: "#fff8e1" }}>
                  <Typography variant="h6" sx={{ color: "orange" }}>{category.title}</Typography>
                  <ul>
                    {category.items.map((item, i) => (
                      <li key={i}>{item}</li>
                    ))}
                  </ul>
                </Paper>
              </Grid>
            ))}
          </Grid>
        </Container>
      </div>
    </div>
  );
};

export default Home;
